// import Navbar from "../Navbar";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import { Container }  from "react-bootstrap";
import './Shop.css'; 
import Img5 from'./Img5.jpg';

function Shop() {
    return(
        <div>
            <h1> Our <br> Products</br></h1> 
        <Container fluid>
        <Row>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
        </Row>
        <Row>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
        </Row>
        <Row>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
            <Col><img src={Img5} style={{width:"30%"}}></img></Col>
        </Row>
        </Container>
        </div>
    )
}

export default Shop
